import React from "react";

interface Props {
    languages: string[],
    icon: string,
    sections: string[],
}

class Header extends React.PureComponent<Props>{
    render() {
        const { icon, languages, sections } = this.props;
        var header_segments = [];
        languages.forEach(language => {
            header_segments.push(
                <a href="index.html">{language}</a>
            );
        });
        return (
            <header>
                <img src={icon} alt="planetEarth" />
                <span id="header_dropdown">Sections</span>
                <div id="header_dropdown_content">
                    <p>yeet</p>
                </div>
                {header_segments}
            </header>
        );
    }
}

export default Header;
